// Importing all the required modules
import React from 'react';
import { NavLink } from "react-router-dom";

const Header = () => {
    // Render's Header along with cureent tab highlight
    return (
        <div className="header">
            <div className="container">
                <div className="logo">
                    <NavLink to="/">Logo</NavLink>
                </div>
                <div className="navbar">
                    <ul>
                        <li>
                            {/* On click it will navigate yo respective screen and load components which ic configured in router ( app.js ) */}
                            <NavLink to="/" exact activeStyle={{ color: '#2a6496' }}>Home</NavLink>
                        </li>
                    </ul>
                </div>
                <div className="clear"></div>
            </div>
        </div>
    );
}

export default Header;
